import './Contato.css';

const Contato = () => {
    return (
        <section id="contato" className="contato">
            <h2>Fale Comigo</h2>
            <p>Estou à disposição para discutirmos seu projeto.</p>
            <ul className="contato-lista">
                <li><strong>Email:</strong> <a href="mailto:monisesilva91@hotmail.com">monisesilva91@hotmail.com</a></li>
                <li><strong>WhatsApp:</strong> <a href="https://wa.me/5514991178404" className="cta-botao">Clique para conversar</a></li>
                <li><strong>LinkedIn:</strong> <a href="https://linkedin.com/in/monise-da-silva" target="_blank" rel="noopener noreferrer">Perfil LinkedIn</a></li>
                <li><strong>Instagram:</strong> <a href="https://www.instagram.com/monisedev" target="_blank" rel="noopener noreferrer">Instagram</a></li>
                <li><a href="curriculo.pdf" className="cta-botao" download>Baixar Currículo</a></li>
            </ul>
        </section>
    );
};

export default Contato;
